    // }).then((response) => {
    //   response.json().then((r) => ({ posts: r }))
    // }).catch(() => {
    //   return { posts: data.homepage }
    // })

    return { posts: data.homepage }
  }


  render() {
    const { statistics } = this.props.posts;

    return (
      <div className="bg-dark">
        <h3>{ statistics.totalTrophiesCount }</h3>
      </div>
    )
  }
}

Homepage.propTypes = {
  posts: PropTypes.shape({})
}

export default Homepage


